import React, { useState, useEffect } from 'react'

const HomeFoot = () => {
  const [favo, setFavo] = useState(JSON.parse())
  useEffect(() => {
    console.log('Favorite -> favo', favo)
  })
  return <div>HomeFoot</div>
}

export default HomeFoot
